import React, {useEffect, useState} from 'react';

function App() {
  const [cards, setCards] = useState([]);
  useEffect(() => {
    fetch('https://api.pokemontcg.io/v2/cards?pageSize=10').then((response)=>{
      response.json;
    }).then((data)=>{
      setCards(data)
    })
  }, [])
  return (
    <div className="App">
      {cards.map((item))}
    </div>
  );
}

export default App;
